import React from "react";

function DisplayExtract(vetor){

	var div1 = document.getElementById("date");
	var div2 = document.getElementById("value");
	var div3 = document.getElementById("type");
	var div4 = document.getElementById("operator");
	console.log(vetor.operatorName)
	if (div1){
		div1.innerHTML = vetor.transactionDate
		div2.innerHTML = vetor.operatorName
		div3.innerHTML = vetor.operatorName
		div4.innerHTML = vetor.operatorName
	}
}

export default DisplayExtract
